import React, { Component, useEffect, useState } from 'react'

const Weather = () => {

    const [weather, setWeather] = useState([{}])

    let seconds = 0;
    if (typeof song.date != 'undefined') {
        seconds = Date.now() / 1000 - song.date.uts
    }

    useEffect(() => {
        console.log('Fetching data from backend...')
        fetch('/weather/forecast')
            .then(response => response.json())
            .then(data => {
                console.log('Data fetched:', data)
                setWeather(data.properties.periods[0])
            })
    }, [])

    return (
        <div className='mt-2'>
            {(typeof weather.name != 'undefined') ? (
                <div>
                    <div className='flex-row flex max-h-20'>
                        <a href={song.url} target="_blank" rel="noopener noreferrer">
                            <img src={weather.icon} alt='Weather Image' className="min-w-20 h-20" />
                        </a>
                        <div className='ml-3'>
                            <p className='song-artist leading-5 mt-1'>{song.artist['#text']}</p>
                            <p className='song-title text-xs opacity-70 mt-1'>{song.name}</p>
                        </div>
                    </div>
                </div>
            ) : (
                <p>Loading...</p>
            )}
        </div>
    );
};

export default Weather
